import React from 'react'
import fetch from 'isomorphic-unfetch'
import Link from 'next/link';
import { Row, Col, Card, Button } from 'react-bootstrap'
// american-sign-language-interpreting
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faUpload, faDownload } from '@fortawesome/free-solid-svg-icons';
import { faThumbsUp } from '@fortawesome/free-regular-svg-icons';

import GlobalStyleSheet from '../../../../../styleSheet'

class BulkUpload extends React.Component {
    render() {
        return (
            <div >
                <Row style={styles.row}>
                    <h6 className="mr-auto">Products Bulk Upload</h6>
                    <Link href="/index"><a>Home</a></Link>
                </Row>

                <Row style={styles.row}>
                    <Card style={styles.card}>
                        <Card.Header style={{ background: 'skyblue' }}>Templete</Card.Header>
                        <Card.Body>
                            <Button href="#" variant="danger" size="sm" >
                                <FontAwesomeIcon icon={faDownload} style={styles.fontawesome} />
                                <label>Download</label>
                            </Button>
                        </Card.Body>
                    </Card>
                </Row>

                <Row style={styles.row}>
                    <Card style={styles.card}>
                        <Card.Header style={{ background: 'skyblue' }}>Templete</Card.Header>
                        <Card.Body>
                            <Button href="#" variant="danger" >
                                {/* <FontAwesomeIcon icon={faUpload} style={styles.fontawesome} /> */}
                                <label>Upload</label>
                            </Button>
                        </Card.Body>
                    </Card>
                </Row>

                <style jsx>
                    {`
                        .hover {
                            margin: 5px 15px
                        }
                    `}
                </style>
            </div>
        )
    }
}

const styles = {
    row: {
        margin: '2%',
        padding: '0px'
    },
    card: {
        width: '100%'
    },
    fontawesome: {
        color: 'white',
        marginRight: '5px',
        width: '14px',
        height: '14px',
        maxHeight: '14px',
        maxWidth: '14px',
    },
}

export default BulkUpload;
